import React from "react";
import './addNew.css';


const AddNew = () => {

    return (
        <div>
            <div>
                <h3 className="headd">Sales Invoice</h3>
                <hr />
            </div>
            <div>

                <label for="documentNo">Document No</label>
                <select id="documentNo" name="documentNo">
                    <option value="autoNumber">Auto Number</option>
                </select>

            </div>
        </div>
    );
}


export default AddNew;
